window.bookSummaryJSON = "<p><b>Hazard King was ready to get back to a normal life…</b></p> <p>Well, as normal a life as the next emperor of the Brittania Empire could expect, anyway. Hazard wanted to continue his naval career—to grow and take on positions of higher responsibility—because he knew the Swarm would be back, and he intended to be there to fight them when they returned.</p> <p>He had learned how to delegate, though, and while he was training, the rest of Team Hazard was tasked with eliminating the Marxist spy network, which they had discovered was mostly made up of rogue Imperial spies.</p> <p>Somewhere along the way, Hazard needed to find time to get married and produce an heir. But at least that shouldn’t be dangerous, right?</p>"; 
